import React from "react";
import { Link } from "react-router-dom";

function StartJourney() {

  return ( 
  <div style={{height:"100vh"}}className="">
    <div className="bg-[url('/images/oscar-keys-background-dark.jpg')]">

    </div>
    <div className="text-pink-700">
    <Link to='/artiststart'>
      <button className="border-solid border-2 border-pink-700 rounded-lg">I am an Artist</button>
    </Link>
    <Link to='/venuestart'>
    <button>I am a Venue</button>
    </Link>
    </div>
  </div>
  )

}

export default StartJourney
